import React from 'react';
import { Drawer, TextField, Box, Container, Toolbar } from '@material-ui/core'

import useStyles from './styles';

const Sidebar = () => {
    const classes = useStyles();

    return (
        <>
            <Drawer className={classes.drawer} variant="permanent" classes={{ paper: classes.drawerPaper, }}>
                <Toolbar >
                    <div className={classes.drawerContainer}>
                        <TextField className={classes.field} select label="Select" //value={years} //onChange={handleChange} helperText="Please select year"
                            variant="filled"
                        ></TextField>
                    </div>
                </Toolbar>
            </Drawer>
        </>
    )
}

export default Sidebar;
